Hi everyone! I want to give a huge thank you to everyone who participated in my #manaredraw event. As usual, listing favorites for this is actual physical pain for me as I have an overflowing folder of favorites and no matter what I do entries I truly adore end up left out. You guys are an outstanding bunch and I love the see the variety of styles and creativity amongst you. If you don’t see yours on this list it doesn’t mean I didn’t love it I just didn’t have room!! That being said here are some of the truly amazing entries I found in the hashtag, I do hope you guys take a look and if you see an artist you like give them a follow and some kind words as well (artists need those we are very mean to ourselves) 

